const muiTheme = createMuiTheme({
  overrides: {
    appBar: {
        colorDefault: {
           color: '#000',
        },
    },
  },
});


export default class Header extends React.Component {
    constructor() {
        super();
        this.state = {
                    search: false,
                    homePage: false,
                    uploadNew: false,
                    profile: true,
            };
        this.classes = muiTheme();
    }



    render() {
        return (
            <MuiThemeProvider muiTheme={muiTheme}>
            <AppBar
                position="fixed"
                color="default"
                className={clsx(this.classes.appBar, {
                    [this.classes.appBarShift]: open,
                }
            )}>;
                <Toolbar>
                    <p>dkdkkdkd</p>
